import React from "react";
import "./autotint.styles.css";

export const Automotivetint = () => {
  return (
    <div className="autotint-main-container">
      <header className="autotint-header">Automotive Tint</header>

      <span className="tint-description">
        With so many window tint films available, making the perfect choice for
        your vehicle has never been easier. From the latest, top of the line
        nano-ceramic, high performance metallic hybrid, and even traditional
        dyed window tint options, there's a PRIME â„¢ film for every application.
        It outperforms other types of tint to keep you comfortable and
        protected. All PRIME Window Tint is backed by lifetime transferable
        warranty.
      </span>

      <span>
        NOT SURE WHAT KIND OF WINDOW FILM YOU NEED? EXPLORE OUR OPTIONS!
      </span>
    </div>
  );
};
